import React from 'react'
import './header.css';
import Logo from './images/logo.png';

const Header = () => {
    return (
        <div className="box-header">
            <div className="box-logo">
                <img src={Logo} />
            </div>
            <div classNamee="box-nav">
                <ul>
                    <li>
                        <a href='/'>LinkedIn handle</a>
                    </li>
                </ul>
            </div>
        </div>
    )
}

export default Header
